[[:<- :d [:data.frame {:counts [:c 15821 139255 652 52212 69957 15676 2864 376 581], :source [:c \"user\" \"user\" \"user\" \"user\" \"user\" \"news\" \"news\" \"news\" \"news\"], :types [:c \"source\" \"retweet\" \"unrelated\" \"reply\" \"share\" \"source\" \"retweet\" \"reply\" \"unrelated\"]}]] [:+ [:+ [:+ [:+ [:ggplot :d [:aes {:y :counts, :fill :source, :x :types}]] [:geom_bar {:stat \"identity\"}]] [:xlab \"Tweet types\"]] [:ylab \"Counts\"]] [:ggtitle \"Tweet type distribution\"]]], :options {:width 10, :height 6}}"}
;; <=

;; @@
(letfn [(ts-freq 
          [pubs]
          (->> pubs
           (map (comp t/hour :ts))
               frequencies
               (map (fn [[k v]] [k (/ v (count pubs))]))
               (into {})))]
  (let [u-freq (ts-freq user-publications)
        s-freq (ts-freq source-publications)
    	dat {:time (into (keys u-freq) (keys s-freq))
             :count (into (vals u-freq) (vals s-freq))
             :type (into (take 24 (repeat "user")) (take 24 (repeat "source")))}]
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
      (gg4clj/r+
        [:ggplot :d [:aes {:x :time :y :count :group :type :color :type}]]
        [:geom_line]
        [:geom_point]
        [:ggtitle "Average Posting-Percentage per Hour per Type"])]
    {:width 12 :height 6})))
