;; **
;;; # Overall Metrics
;; **

;; @@
(let [tweet-count (pmap #(mc/count @db "tweets" {:created_at {$gte % $lt (t/plus % (t/days 1))}}) dates)
      dat {:days (range  2 (inc (inc days-running)))  
           :counts tweet-count}]
  (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
        [:ggplot :d [:aes :days :counts]]
        [:geom_line {:colour "steelblue"}]
        [:geom_point {:colour "steelblue"}]
        [:ggtitle "Daily Tweet Count"])]
    {:width 10}))
